import React from 'react'

const Klientet = () => {
  return (
    <div className='px-5 py-3'>
        <div className='d-flex justify-content-center'>
            <h3>Lista e Klienteve :</h3>
        </div>
        <button className='btn btn-success'>Shto Klienta</button>
    </div>
  )
}

export default Klientet
